import { arrayToTree } from '@/common/util/Trees.js';
export default {
  data: function data() {
    return {
      waiting: false,
      item: {
        name: null,
        cars: [],
        area: null,
        des: null,
        regions: [],
        auser: $_main.userId
      },
      cars: [],
      regions: [],
      callback: null
    };
  },
  mounted: function mounted() {
    if (this.item.id) {
      this.regions = JSON.parse(this.item.regions);
    }
  },
  methods: {
    iconCssFunction: function iconCssFunction(node, open) {
      return !node.carId ? open ? 'ico_open' : 'ico_close' : null;
    },
    iconCssFunction1: function iconCssFunction1(node, open) {
      return node.type == '0' ? open ? 'ico_open' : 'ico_close' : null;
    },
    getTreeRoots: function getTreeRoots(callback) {
      $_main.http.get('data/getCars', {
        sessionId: $_main.sessionId
      }).then(function (result) {
        result.carList.forEach(function (el) {
          el.id = el.carId;
          el.pid = el.teamId;
          el.name = el.carName;
        });
        result.teamList.forEach(function (el) {
          el.id = el.teamId;
          el.name = el.teamName;
        });
        var root = {
          id: '0',
          name: $_L.get('所有车辆'),
          children: []
        };
        var children = arrayToTree(result.teamList.concat(result.carList));
        children.forEach(function (node) {
          return node.parent = root;
        });
        root.children = children;
        callback(root);
      });
    },
    getTreeRoots1: function getTreeRoots1(callback) {
      $_main.http.get('data/getPois', {
        sessionId: $_main.sessionId
      }).then(function (result) {
        var root = {
          id: '0',
          name: $_L.get('所有标注'),
          children: []
        };
        var children = arrayToTree(result);
        children.forEach(function (node) {
          return node.parent = root;
        });
        root.children = children;
        callback(root);
      });
    },
    getTreeRoots2: function getTreeRoots2(callback) {
      $_main.http.get('data/getRegions', {
        sessionId: $_main.sessionId
      }).then(function (result) {
        var root = {
          id: '0',
          name: $_L.get('所有区域'),
          children: []
        };
        var children = arrayToTree(result);
        children.forEach(function (node) {
          return node.parent = root;
        });
        root.children = children;
        callback(root);
      });
    },
