        regionId: null,
        speed: null,
        mile: null,
        rev: null,
        gear: null,
        appPid: null
      });
    },
    submit: function submit() {
      var _this = this;

      if (!this.item.name) return $_alert.warn($_L.get('请输入工况名称！')); // if(!this.item.area)return $_alert.warn($_L.get('请填写所在地区！'));

      if (!this.regions || this.regions.length == 0) return $_alert.warn($_L.get('请添加标注，标注不能小于1个！'));

      for (var k in this.regions) {
        if (!this.regions[k].regionId) return $_alert.warn($_L.get('请选择标注点！'));
      }

      var isadd = this.item.id ? false : true;
      var url = this.item.id ? 'rule/update' : 'rule/add'; // this.item.cars=this.cars.toString()

      this.item.regions = JSON.stringify(this.regions);
      $_main.http.post(url, this.item).then(function (result) {
        _this.callback(result, isadd);

        $_alert.success(isadd ? $_L.get('新增成功') : $_L.get('修改成功'));

        _this.$refs.w.close();
      }).catch(function (error) {
        _this.waiting = false;
      });
    }
  }
